import { Link } from "react-router-dom";
import BottomBar from "../components/navbar/BottomBar";

const LandingPage = () => {
  return (
    <div className="landing-page">
      {/* Scrolling photos */}
      <div className="scrolling-photos">
        <div className="photo-wrapper">
          <div className="photo photo1"></div>
          <div className="photo photo2"></div>
          <div className="photo photo3"></div>
          <div className="photo photo4"></div>
          <div className="photo photo5"></div>
          <div className="photo photo6"></div>
        </div>
      </div>

      {/* Glassmorphism content */}
      <div className="glass-content">
        <div className="content">
          <h2 className="title">Welcome to Fatafat Yatra</h2>
          <p className="subtitle">Book your tickets with ease and enjoy your journey.</p>
          <div className="cta-button">
            <Link to="/Home" className="button">Book Now</Link>
          </div>
        </div>
      </div>

      {/* Bottom Navbar */}
      <BottomBar />
    </div>
  );
};

export default LandingPage;
